//header == navbar
import React from 'react'
import logo from '../favicon.ico'
import '../css/Navbar.css'

const Navbar = (props) => {
console.log(props);

  return(
    <>
    {
      props.data.map((curr,currIndex)=>{
        return(
          <>
          <div className="main" key={curr}>
            <h2>{props.data[currIndex].cardData.Name}</h2>
          </div>
          </>
        )
      })
    }
    </>
  )

}

export default Navbar
